@instylemagazine was kind enough to name me September's Man of Style. You can buy the #magazine on the stands now if it pleases you.

This photo shoot was geared toward releasing the #magnificent #magnificent7 Movie in theaters September 23rd.

Full disclosure I did not pick out any of the clothes which is kinda funny for a guy who is called the "man of style" üòÇ I mostly like T shirts with American flags on them. Usually I go for the one on the top of the "shirt pile"  but I want to promote this nice magazine called In Style Magazine because everyone who was there that hot day we were doing the photo shoot was really nice. They had nice food spread out. And they played good country music. And there were horses all over the place. I feel like I took some pictures with some horses but those didn't make the magazine. Maybe I accidentally closed my eyes or maybe the horse's agent threw a Hollywood bitch fit for some reason. The people who picked out the clothes have good style. No doubt. Oh! They even gave me a shirt!!!! Such a nice shirt. Like a flannel shirt but made out of pajamas and the thing cost like $500 or something ridiculous but they just gave it to me!!! So. Anyways. Hopefully this helps them at least sell $500 worth of magazines to make up for that sweet ass shirt. It's up in Washington so I can't send a pic right now of the shirt. But trust me. It's great.

@instylemagazine September 2016 Man of Style on newsstands now.  Photographed by @thomaswhiteside; styled by @jamesvaleri; photo director @lisamartin0563; grooming by @bridgetbragerhair; production by @kelseystevensproduction.
